INSERT INTO `posts` (`id`, `tieude`, `noidung`, `username`, `created_at`, `theloai`, `ghimbai`, `image`, `trangthai`, `tinhtrang`) VALUES
	(1, 'Tính năng Mở Lý Cánh Thời Trang', '[left][color=#000000][size=20][font=Arial]- Mở ly sẽ update thêm vật phẩn mới : Cánh Thiên Thanh , Cánh Ngũ Sắc , Cánh Hỏa Tinh , Cánh Cầu Vòng \n- Để mở ly cánh thời trang các bạn cần vé mở ly cánh.\n- Nếu may mắn các bạn thể mở được vật phẩm vĩnh viễn.[/font][/size][/color][/left]\n\n', 'chipdev', '2023-11-05 22:45:27', 0, 1, NULL, 0, 0),
	(2, 'Hướng dẫn - Chức năng THUÊ BẢO HỘ [đi buôn]', '[color=#1e5b7e][size=15][font=Arial][b]Hướng dẫn - Chức năng THUÊ BẢO HỘ [đi buôn][/b][/font][/size][/color]\n[center][color=#000000][size=15][font=Arial][b]HIỆP SĨ BẢO HỘ[/b][/font][/size][/color][/center]\n[color=#000000][size=15][font=Arial]\n\n- Một thương nhân chỉ được thuê 1 hiệp sĩ bảo hộ trong 1 chuyến buôn.\n\n- Hiệp sĩ được thuê bảo hộ phải đứng gần thương nhân và vật buôn , cùng khu cùng map\n\n- Chỉ có thể thuê được hiệp sĩ bảo hộ khi đang đi buôn và thả vật buôn\n\n- Thuê bảo hộ bằng cách vào MENU CHỨC NĂNG -> KHÁC -> THUÊ BẢO HỘ[/font][/size][/color]\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/16643597441211.png[/img][/font][/size][/color][/center]\n[color=#000000][size=15][font=Arial]\n\n- Nhập tên nhân vật của HIỆP SĨ để mời[/font][/size][/color]\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/16643597446645.png[/img][/font][/size][/color][/center]\n\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/16643597444569.png[/img][/font][/size][/color][/center]\n[color=#000000][size=15][font=Arial]\n\n- Số lần bảo hộ hiệp sĩ là 3 lần, thời gian bảo hộ Hiệp sĩ là 30 giây cho mỗi lần sử dụng, có cộng dồn nếu dùng nhiều lần bảo hộ.\n\n- Thương nhân bấm vào con buôn để hiển thị hiệp sĩ bảo hộ[/font][/size][/color]\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/16643598864778.png[/img][/font][/size][/color][/center]\n[color=#000000][size=15][font=Arial]\n\n- Sau mỗi lần hoàn thành chuyến buôn hoặc hết giờ đi buôn thì sẽ được reset người bảo hộ[/font][/size][/color]\n', 'chipdev', '2023-11-05 23:08:25', 0, 1, NULL, 0, 0),
	(3, 'Hướng Dẫn - Làng Phủ Sương', '[color=#1e5b7e][size=15][font=Arial][b]Hướng Dẫn - Làng Phủ Sương[/b][/font][/size][/color]\n[center][color=#000000][size=15][font=Arial][b][color=red]Làng Phủ Sương [CHÍNH THỨC][/color][/b][/font][/size][/color][/center]\n\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/16814583446682.png[/img][/font][/size][/color][/center]\n\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/16813767175663.png[/img][/font][/size][/color][/center]\n[color=#000000][size=15][font=Arial]\n\n- Game ra mắt một vùng đất mới được gọi là Làng Phủ Sương , để vào được thì người chơi phải đến NPC Oda để đi đến đó\n- Nhân vật phải có level 100 trở lên mới có thể đi vào\n- Để đi đến map quái để tập luyện thì phải có vé bán ở Beatrix ở làng phủ sương, rồi đến NPC SERENA ở làng phủ sương chọn Vượt làng phủ sương\n- Vào map quái thành công thì sẽ trừ 1 vé với thời gian là 4 giờ up\n- Bạn sẽ được NPC đưa vào hoàn toàn ngẫu nhiên map [tương ứng với level nhân vật].\n\nCó tổng cộng 10 map quái\nLevel 100-109 sẽ được đưa vào map quái lv 100 và quái 105 [có 2 map]\nLevel 110-119 sẽ được đưa vào map quái lv 110 và quái 115 [có 2 map]\nLevel 120-129 sẽ được đưa vào map quái lv 120 và quái 125 [có 3 map]\nLevel 130-139 sẽ được đưa vào map quái lv 130 và quái 135 [có 3 map]\n\n- Một map chỉ tối đa 20 người , khi map đầy sẽ không thể vào thêm được nữa\n- Nếu người chơi giết nhau thì sẽ bị đưa về làng phủ sương ngay lập tức cả người giết và người bị chết .\n- Bị quái cắn chết cũng sẽ bị đưa ngay về làng phủ sương\n- Đánh quái ở đây sẽ nhận được kinh nghiệm cao hơn so với map quái bình thường, vật phẩm giá trị cũng rơi nhiều hơn như Lông các loại , Xương , Trang bị Tím/Cam khóa , Mảnh sách ghép , Đá hỏa tinh , Nguyên tố cho GIÁP SƯU TẬP , phù về làng , nl tinh tú v.v cũng như không có sự quấy nhiễu của CON MA\n- Up vàng trên đây không bị tính ip\n- Ngoài ra có boss ở vùng đất sẽ xuất hiện ở đây để các bạn săn , cứ 8h tái sinh 1 lần mỗi map\n- Khi nhân vật offline mà vẫn còn thời gian vượt làng phủ sương thì không bị tính\n- Pet Không đồ sát không được áp dụng.[/font][/size][/color]\n', 'chipdev', '2023-11-05 23:10:27', 0, 1, NULL, 0, 0),
	(4, 'Hướng Dẫn - Chức năng CHIẾM MỎ', '[color=#1e5b7e][size=15][font=Arial][b]Hướng Dẫn - Chức năng CHIẾM MỎ[/b][/font][/size][/color]\n[color=#000000][size=15][font=Arial]- Thời gian chiếm mỏ sẽ bắt đầu vào lúc 8h sáng và 20h (8h tối) hàng ngày, thời gian diễn ra cuộc chiến vẫn là 1 tiếng và giãn cách 11 tiếng sau mỗi trận chiến chiếm mỏ.\n\nBên dưới đây là danh sách tất cả Mỏ tài nguyên đã được cập nhật trong game (nhớ vào khu vực 5), lưu ý là một bang có thể chiếm bao nhiêu mỏ cũng được nên hãy sắp xếp chiến thuật cho hợp lý nhé:\n\n1 - Khu bìa rừng > mỏ vàng\n2 - Rừng ảo giác > mỏ kinh nghiệm\n3 - Thung lũng kỳ bí > mỏ ngọc\n4 - Hồ ký ức > mỏ kinh nghiệm\n\n5 - Bờ biển > mỏ vàng\n6 - Vực đá > mỏ vàng (vừa fix lại)\n7 - Đầm lầy > mỏ kinh nghiệm\n8 - Đền cổ > mỏ vàng\n\n9 - Cửa biển > mỏ vàng\n10 - Đồi cát > mỏ ngọc\n11 - Vực lún > mỏ kinh nghiệm\n12 - Nghĩa địa cát > mỏ vàng\n\n13 - Suối ma > mỏ kinh nghiệm\n14 - Thung lũng đá > mỏ ngọc\n\n15 - Rừng cao nguyên > mỏ vàng\n16 - Đèo hoang sơ > mỏ ngọc\n\nMột số điểm cần lưu ý khi bang hội chiếm Mỏ tài nguyên:\n- Mỏ tài nguyên chỉ có thể chiếm được khi giờ chiến bắt đầu.\n- Nếu mỏ tài nguyên có lượng HP thấp hơn 50%, nó sẽ tự động kích hoạt cơ chế tự hồi máu liên tục cho đến khi hồi HP hoàn toàn.\n- Cứ mỗi lần mỏ đá bị phá hủy, lần hồi sinh tiếp theo nó sẽ có lượng HP nhiều hơn.\n- Nếu quái nhân bản còn tồn tại, nó sẽ tạo ra phép bổ trợ khiến Mỏ đá có chỉ số phòng thủ và kháng bằng với chỉ số của quái nhân bản.[/font][/size][/color]\n', 'chipdev', '2023-11-05 23:11:43', 0, 1, NULL, 0, 0),
	(5, 'Hướng Dẫn - Chức Năng THÀNH TÍCH', '[color=#1e5b7e][size=15][font=Arial][b]Hướng Dẫn - Chức Năng THÀNH TÍCH[/b][/font][/size][/color]\n[center][color=#000000][size=15][font=Arial][b][color=red]Thành Tích[/color][/b][/font][/size][/color][/center]\n[color=#000000][size=15][font=Arial]\n\n- Có 3 mốc thành tích trong game là Đại Gia , Triệu Phú , Tỷ Phú.\n- Khi các bạn nạp 1 ngọc sẽ nhận ngay 1 điểm nạp ngọc.\n- Khi các bạn dùng 1 ngọc vào chức năng bất kì sẽ nhận ngay 1 điểm dùng ngọc\n- Khi người chơi đủ điều kiện của mốc thành tích có thể đến trực tiếp NPC Hammer/ Black Eye để nhận (nếu vẫn còn số lượng) . Cứ ngày 1 hằng tháng reset lại thành tích và điểm .[/font][/size][/color]\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/16230396023613.png[/img][/font][/size][/color][/center]\n[color=#000000][size=15][font=Arial]\n\n- ĐIỂM NẠP và ĐIỂM DÙNG chỉ tính [b][color=red]sau khi bảo trì định kỳ ngày 1 hằng tháng[/color][/b]\n\n[b]- Lưu ý áo choàng chỉ mở đổi vào lúc 11h-11h30 mỗi ngày.\nLevel 40 trở lên mới có thể đổi.[/b]\n[/font][/size][/color]\n[center][table][tr][td][color=#000000][size=15][font=Arial][color=#ffffff][b]Quyền lợi thành tích[/b][/color][/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial][color=#ffffff][b]Mốc "Đại Gia"[/b][/color][/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial][color=#ffffff][b]Mốc "Triệu Phú"[/b][/color][/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial][color=#ffffff][b]Mốc "Tỷ Phú"[/b][/color][/font][/size][/color][/td]\n[/tr]\n[tr][td][color=#000000][size=15][font=Arial]Số lượng[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial][color=#00BFFF]40 người[/color][/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial][color=#00BFFF]20 người[/color][/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial][color=#00BFFF]10 người[/color][/font][/size][/color][/td]\n[/tr]\n[tr][td][color=#000000][size=15][font=Arial]Điểm nạp tối thiểu[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]50 điểm[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]300 điểm[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]600 điểm[/font][/size][/color][/td]\n[/tr]\n[tr][td][color=#000000][size=15][font=Arial]Điểm dùng tối thiểu[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]19 điểm[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]99 điểm[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]399 điểm[/font][/size][/color][/td]\n[/tr]\n[tr][td][color=#000000][size=15][font=Arial]Miễn phí khi đi dịch chuyển[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]CÓ[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]CÓ[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]CÓ[/font][/size][/color][/td]\n[/tr]\n[tr][td][color=#000000][size=15][font=Arial]Loa thế giới miễn phí[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]1 lần MỖI NGÀY[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]3 lần MỖI NGÀY[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]3 lần MỖI NGÀY[/font][/size][/color][/td]\n[/tr]\n[tr][td][color=#000000][size=15][font=Arial]Tăng vàng nhận được khi bán đồ\n(phi đồ vào shop)[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]Tăng 20%[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]Tăng 50%[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]Tăng 100%[/font][/size][/color][/td]\n[/tr]\n[tr][td][color=#000000][size=15][font=Arial]Không giới hạn số lượt vào khu 2 bằng ngọc[/font][/size][/color][/td]\n[td][/td]\n[td][color=#000000][size=15][font=Arial]CÓ[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]CÓ[/font][/size][/color][/td]\n[/tr]\n[tr][td][color=#000000][size=15][font=Arial]Thông báo khi log i