/color][/td]\n[/tr]\n[tr][td][color=#000000][size=15][font=Arial]Tham gia Paragon[/font][/size][/color][/td]\n[td][/td]\n[td][color=#000000][size=15][font=Arial]Miễn phí[/font][/size][/color][/td]\n[td][color=#000000][size=15][font=Arial]Miễn phí[/font][/size][/color][/td]\n[/tr]\n[/table]\n[/center]\n[color=#000000][size=15][font=Arial]\n\n- Bất kì trường hợp nào mất áo choàng thành tích , hãy đến thẳng NPC đổi áo choàng để bấm nhận lại . Bắt đầu từ tháng 7 , thành tích của chúng ta đều là 30 ngày.[/font][/size][/color]\n', 'chipdev', '2023-11-05 23:12:09', 0, 1, NULL, 0, 0),
	(6, 'NỘI DUNG UPDATE MỚI : TRANG BỊ TINH TÚ', '[color=#1e5b7e][size=15][font=Arial][b][color=#FF1493]NỘI DUNG UPDATE MỚI : TRANG BỊ TINH TÚ[/color][/b][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]Cống Nạp[/b][/color][/font][/size][/color][/center]\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/15970502708228.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n- Hoàn thành chuỗi nhiệm vụ tinh tú có thể cống nạp . Các bạn chỉ có thể cống nạp sau khi hoàn thành chuỗi 10 nhiệm vụ tại NPC Sophia\r\n- Cống nạp tại NPC Keva tại map Bìa Rừng. Mỗi ngày luôn có cống nạp khác nhau\r\n\r\n[/font][/size][/color]\r\n[table][tr][td][center][color=#000000][size=15][font=Arial][color=#ffffff][b]Cống Nạp[/b][/color][/font][/size][/color][/center]\r\n[/td]\r\n[td][center][color=#000000][size=15][font=Arial][color=#ffffff][b]Nhận Lại[/b][/color][/font][/size][/color][/center]\r\n[/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]10 đá may mắn[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]1 đồ cam không khóa ngẫu nhiên cùng lv nhân vật[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]20 titan[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]100.000 vàng[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]10 cường hóa[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]1 lửa ánh sao[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]5 ngọc[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]1 lửa kỳ lân[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]2 đồng horae[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]1 đá thách anh cấp 1[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]1 đá ba màu[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]2 đá ba màu[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]10 thánh giá[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]20 thú cưỡi chuột tuyết[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]10 titan[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]100 kim loại vũ trụ[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]30 cỏ bốn lá[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]1 tăng tốc cánh cấp 1[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]1.000.000 vàng[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]1 lửa bóng tối[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]10 ngựa trắng[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]1 lửa địa ngục[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]20 đá may mắn[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]1 lửa cực quang[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]5 lông vàng[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]10 lông đỏ[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]5 lông đỏ[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]10 lông vàng[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]5 lông xanh[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]10 khúc xương[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]500 huy hiệu hiệp sĩ[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]1 lửa rồng gai[/font][/size][/color][/td]\r\n[/tr]\r\n[tr][td][color=#000000][size=15][font=Arial][b]2 đồng tyche[/b][/font][/size][/color][/td]\r\n[td][color=#000000][size=15][font=Arial]1 lửa trường sinh[/font][/size][/color][/td]\r\n[/tr]\r\n[/table]\r\n\r\n\r\n[center][color=#000000][size=15][font=Arial][color=red][b]Nhiệm Vụ Tinh Tú[/b][/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n- Nhiệm vụ tinh tú nhận tại NPC Sophia. Thời gian làm nhiệm vụ là trong ngày . Qua ngày sẽ tiến hành reset nhiệm vụ tinh tú . Mỗi ngày đều có chuỗi nhiệm vụ khác nhau. Hoàn thành xong nhiệm vụ tinh tú sẽ có thể cống nạp\r\n- Mỗi ngày sẽ có thể làm chuỗi nhiệm vụ tinh tú (gồm 10 nhiệm vụ nhỏ) 1 lần mà thôi .\r\n- Các bạn thực hiện từng nhiệm vụ nhỏ đều có phần thưởng riêng .\r\n- Khi gặp nhiệm vụ không thích làm hay không muốn làm có thể [b]Hoàn Thành[/b]và [b]Thay Đổi[/b] . Các bạn sẽ có 1 lần [b]Thay Đổi [/b]miễn phí . Lần kế tiếp sẽ tốn ngọc. Không giới hạn Thay Đổi. 1 lần thay đổi tăng tiến ngọc.\r\n- Khi chọn [b]Hoàn Thành[/b] nhiệm vụ thì được tính đã làm xong , các bạn có thể tiếp tục làm nhiệm vụ kế tiếp. Mỗi ngày chỉ được 1 lần [b]Hoàn Thành[/b] . [b]Hoàn Thành[/b] mất phí ngọc\r\n- Để [color=red][b]Thay Đổi[/b][/color] hay [color=red][b]Hoàn Thành[/b][/color] các bạn vào [b]CHỨC NĂNG -> KHÁC[/b]\r\n- Khi các bạn hoàn thành nhiệm vụ thì sẽ không bị trùng lặp lại .\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]Danh Sách Nhiệm Vụ Tinh Tú[/b][/color][/font][/size][/color][/center]\r\n\r\n[table][tr][td][center][color=#000000][size=15][font=Arial][color=#ffffff][b]Tên Nhiệm Vụ[/b][/color][/font][/size][/color][/center]\r\n[/td]\r\n[td][center][color=#000000][size=15][font=Arial][color=#ffffff][b]Nội Dung[/b][/color][/font][/size][/color][/center]\r\n[/td]\r\n[td][center][color=#000000][size=15][font=Arial][color=#ffffff][b]Phần Thưởng[/b][/color][/font][/size][/color][/center]\r\n[/td]\r\n[/tr]\r\n[