bị màu vàng - tím - cam trở lên\r\n- Thực hiện chức năng tách trang bị bằng cách click chọn vào trang bị và chọn chức năng tách đồ.\r\n- Khi tách trang bị sẽ có tỉ lệ thất bại , khi thất bại các bạn sẽ không thu được nguyên liệu gì cả\r\n- Trang bị có màu càng cao thì tỉ lệ tách xịt càng giảm.\r\n- Chi số cộng < 8 : nhận được 1 viên.\r\n- Chỉ số cộng >=8 và <=11 : nhận 2 viên.\r\n- Chỉ số cộng >11 nhận 3 viên nguyên liệu .\r\n- Màu vàng nhận ngẫu nhiên 5 loại nguyên liệu đầu.\r\n- Màu tím ngẫu nhiên 7 loại nguyên liệu đầu\r\n- Màu cam ngẫu nhiên 10 loại nguyên liệu[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/15970502702554.png[/img][/font][/size][/color][/center]\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/15970502705072.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n[b]- Nhóm 2 rơi trong phó bản[/b]\r\n  Bạc tinh luyện\r\n  Thép tinh luyện\r\n  Thạch anh tím\r\n  Đồng tinh luyện\r\n  Lục bảo tinh luyện\r\n  Sắt tinh luyện\r\n  Vàng tinh luyện\r\n  Ngọc xà cừ\r\n  Ngọc mắtmèo\r\n  Đá hồng ngọc\r\n\r\n[b]- Nhóm 3 gồm trong 4 map đào ngọc[/b]\r\n  Thiên thạch Sao Thủy\r\n  Thiên thạch Sao Kim\r\n  Thiên thạch Sao Hỏa\r\n  Thiên thạch Sao Mộc\r\n  Thiên thạch Sao Hải Vương\r\n  Thiên thạch Sao Thiên Vương\r\n  Thiên thạch Sao Diêm Vương\r\n  Thiên thạch sao Thổ\r\n  Thiên thạch Mặt Trăng\r\n  Mảnh hóa thạch\r\n  Đá ảo giác\r\n  Đá thiên hà\r\n  Đá phù thủy\r\n  Đá lời nguyền\r\n  Đá tiên tri\r\n  Đá giả kim\r\n  Đá phục sinh\r\n  Đá pha lê\r\n  Nước mắt thiên sứ\r\n  Đá trường sinh\r\n\r\n[b]Lửa đặc biệt[/b]\r\n  Lửa Cực Quang\r\n  Lửa Bóng Tối\r\n  Lửa Kỳ Lân\r\n  Lửa Trường Sinh\r\n  Lửa Rồng Gai\r\n  Lửa Địa Ngục\r\n  Lửa Ánh Sao\r\n\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]Chế Tạo Đồ Tinh Tú[/b][/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n- Để chế tạo trang bị tinh tú , các bạn cần đến NPC [b]Hammer/Black Eye[/b] chọn Set đồ tinh tú -> chọn class mà mình muốn chế tạo . Các bạn lưu ý chỉ những item chia class rõ ràng mới có thể chọn . Còn lại không chia class như găng , nhẫn ... thì ngẫu nhiên hoàn toàn khi chế tạo\r\n- Công thức chế tạo sẽ bao gồm : nguyên liệu lửa đặc biệt , nguyên liệu mề đay vàng , nguyên liệu mề đay tím , 2 nhóm nguyên liệu tinh tú\r\n- Đồ tinh tú cũng có các màu theo thứ tự từ thấp đến cao : trắng , xanh dương , vàng , tím , cam , xanh lá\r\n- Đố trắng , xanh dương , vàng không thể nâng cấp , chỉ có thể cường hóa\r\n- Từ đồ tím trở lên có thể nâng cấp và có thể cường hóa .\r\n- Khi mới chế tạo , đồ tinh tú sẽ có level là 45\r\n- Mỗi lần nâng cấp sẽ tăng 10 level. Cấp 10 là cao nhất.\r\n- Nâng cấp sẽ không bị tụt cường hóa\r\n- Nếu nâng cấp thất bại , vật phẩm giảm 1% độ bền. Nếu độ bền còn 0% món đó sẽ không thể nâng cấp được nữa.\r\n- Có 3 mốc nâng cấp sẽ ngẫu nhiên lại nguyên liệu nâng cấp là cấp [b]3/6/9.[/b]\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]Chỉ Số May Mắn trên Đồ Tinh Tú[/b][/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n- Xuất hiện ở trang bị từ tím/cam/xanh lá.\r\n- Chỉ số có tác dụng tăng % của tỉ lệ thành công nâng cấp , tối đa là 9%\r\n- Ngoài ra trang bị có chỉ số may mắn khi nâng cấp thất bại sẽ giúp bảo vệ không tụt % độ bền khi tỉ lệ xảy ra .\r\n- Chỉ số may mắn không cộng dồn tất cả trang bị tinh tú có trên người , chỉ tính may mắn của item đó khi nâng cấp\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]Dòng Ẩn trên Đồ Tinh Tú[/b][/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n- Từ Đồ cam có thể có tối đa 2 dòng ẩn . Đồ xanh lá có thể có tối đa 3 dòng ẩn.\r\n- Khi mới chế tạo , các bạn sẽ xem được dòng ẩn trên trang bị\r\n- Nhưng để kích hoạt được dòng ẩn các bạn phải mặc đủ toàn bộ nhóm trang bị để kích hoạt dòng ẩn\r\n- Tất cả trang bị tinh tú sẽ được chia thành 3 nhóm , các dòng ẩn cũng sẽ phân bố 1 cách có tính toán theo các nhóm chứ không phải dòng ẩn nào cũng có thể xuất hiện trên toàn bộ item tinh tú.\r\n\r\n♦ Nhóm 1\r\nÁo/Quần : dòng ẩn : miễn sát thương vật lý/băng/điện/độc/lửa\r\nvà Nón : dòng ẩn : giáp bảo hộ/bộc phá/hung tàn\r\n→ Khi mặc đủ 3 món tinh tú thuộc nhóm 1 : toàn bộ dòng ẩn có có trên item nhóm 1 đều sẽ được kích hoạt\r\n\r\n♦ Nhóm 2\r\nVũ khí : dòng ẩn : sát thương chuẩn/bộc phá/chính xác/giáp bạch kim/giáp thiên sứ/giáp vệ binh\r\n2 Nhẫn : dòng ẩn : ngu đần/bất tử/mù mắt/chính xác/giáp bạch kim/giáp thiên sứ/giáp vệ binh\r\n→ Khi mặc đủ 3 món tinh tú thuộc nhóm 2 : toàn bộ dòng ẩn có có trên item nhóm 2 đều sẽ được kích hoạt\r\n\r\n♦ Nhóm 3 :\r\nDây Chuyền : dòng ẩn : bất tử/hung tàn/thiêu cháy/tàn phế\r\nGăng : dòng ẩn : ngu đần/thiêu cháy/tàn phế\r\nGiày : dòng ẩn : mù mắt /thiêu cháy/tàn phế\r\n→ Khi mặc đủ 3 món tinh tú thuộc nhóm 3 : toàn bộ dòng ẩn có có trên item nhóm 3 đều sẽ được kích hoạt\r\n\r\n[b]*Lưu ý : Nhẫn mặt trăng, Dây Chuyền Mặt Trăng có thể kích hoạt dòng ẩn nhóm đó nếu mang vào.[/b]\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]Giải Thích về Dòng Ẩn[/b][/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n[b]- Miễn sát thương lửa:[/b]có tỉ lệ xảy ra , khi xảy ra thì bỏ qua sát thương này\r\n[b]- Miễn sát thương độc:[/b] có tỉ lệ xảy ra , khi xảy ra thì bỏ qua sát thương này\r\n[b]- Miễn sát thương vật lý:[/b] có tỉ lệ xảy ra , khi xảy ra thì bỏ qua sát thương này\r\n[b]- Miễn sát thương băng:[/b]có tỉ lệ xảy ra , khi xảy ra thì bỏ qua sát thương này\r\n[b]- Miễn sát thương điện:[/b] có tỉ lệ xảy ra , khi xảy ra thì bỏ qua sát thương này\r\n[b]- Giáp bảo hộ :[/b] xảy ra khi bị người khác đánh, tồn tại trong 10s, trong 10s nếu bị đánh liên tiếp từ 3 lần sẽ giảm sát thương của người đánh đi : 100% - 75% - 50%.\r\n[b]- Bộc phá :[/b] khi bị đánh sẽ có tỷ lệ xảy ra, tạo vụ nổ gay sát thương random 10- 40% máu cho đối thủ trong khoảng cách 6 ô.\r\n[b]- Hung tàn :[/b] có tỉ lệ xảy ra , thời gian tồn tại hiệu ứng 20s . Khi xảy ra sẽ ngẫu nhiên yêu cầu hít đánh , đánh đủ hít yêu cầu là hút 3-5% max máu cho mình. Nếu vẫn còn thời gian tồn tại thì vẫn tiếp tục random lại hít yêu cần và vẫn sẽ hút lượng máu khi thỏa điều kiện đó\r\n[b]- Chính xác :[/b] có tỉ lệ xảy ra , khi đánh kẻ thù xảy ra dòng này giúp giảm đi né tránh 90% của kẻ thù.\r\n[b]- Giáp bạch kim :[/b] có tỉ lệ xảy ra , khi đánh kẻ thù xảy ra dòng này giúp giảm đi chí mạng của kẻ thù đi 90%.\r\n[b]- Giáp thiên sứ :[/b] có tỉ lệ xày ra , khi đánh đối thủ xảy ra dòng này thì giảm phản dame của kẻ thù đi 90%\r\n[b]- Giáp vệ binh :[/b] có tỉ lệ xảy ra , khi bạn bị đánh , nếu hiệu ứng xảy ra thì giảm xuyên giáp của kẻ thù đi 90%.\r\n[b]- Ngu đần :[/b] Tác dụng làm con Pet của kẻ thù bị mất tác dụng trong thời gian 30 giây.\r\n[b]- Bất tử :[/b] Khi bị kẻ thù đánh ,lượng máu sau sát thương đó nếu rơi vào <= 5% max máu thì bất tử sẽ xuất hiện trong 5s. Bạn sẽ được bất tử trong đòn đánh đó . Trong thời gian đó , sát thương khi đánh người khác = 0, có thời gian cooldowwn giữa các lần.\r\n[b]- Mù mắt :[/b] Khi đánh đối thủ làm cho đối thủ bị mù mắt trong 5s, có tỷ lệ xảy ra, khi mù mắt thì đánh skill sẽ hụt.\r\n[b]- Thiêu cháy :[/b] Khi bị đánh , và máu còn <= 30% sẽ xảy ra , thời gian tồn tại 20s, cứ sau 3s là sẽ trừ 5000 máu cho ai đứng gần, có thời gian cooldown.\r\n[b]- Tàn phế : [/b]Khi đánh đối thủ, xảy ra sẽ trừ Mp đối thủ còn 1%, cấm hồi Mp trên trang bị trong vòng 5s.\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][b][color=red]Mở mua bán đồ tinh tú[/color][/b][/font][/size][/color][/center]\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/15985225712280.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n- Tất cả đồ tinh tú trắng , xanh dương , vàng , tím , cam sẽ treo bán bình thường như những trang bị khác ở trên khu mua bán. Y như bán trang bị mà thôi , không có gì đặc biệt thay đổi.\r\n\r\n- Đối với đồ tinh tú trắng , xanh dương , vàng , tím , cam mà [KHÓA] thì cho mua bán trên khu mua bán đặc biệt và vẫn cần các thẻ đồng , bạc , vàng đúng loại đồ giữa 2 bên mua/bán . Y như bán trang bị KHÓA mà thôi , không có gì đặc biệt thay đổi\r\n\r\n- Đối với đồ tinh tú xanh lá , chỉ có thể treo bán khi có đồng tinh tú [img]http://my.teamobi.com/app/view/forum/15985225712869.gif[/img] mà thôi , khóa hay không thì bên bán và mua cũng cần đồng tinh tú mới có thể mua bán cho nhau.\r\n\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][b][color=red]Mở tách đồ tinh tú[/color][/b][/font][/size][/color][/center]\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/15985225715890.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n\r\n- Cho tách đồ tinh tú xanh dương , vàng , tím , cam . Tỉ lệ tách đồ tinh tú cực kì cao\r\n- Tỉ lệ tách đồ tinh tú không phụ thuộc vào chỉ số cộng , bất cứ level nào cộng nào cũng có thể tách[/font][/size][/color]\r\n', 'chipdev', '2023-11-05 23:12:40', 0, 1, NULL, 0, 0),
	(7, 'Hướng Dẫn - Chức Năng CHẾ TẠO MỀ ĐAY', '[color=#1e5b7e][size=15][font=Arial][b]Hướng Dẫn - Chức Năng CHẾ TẠO MỀ ĐAY[/b][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][b][color=red][font=verdana]Mề Đay[/font][/color][/b][/font][/size][/color][/center]\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14682107082673.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n∇ Chế tạo Mề Đay[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14682084944073.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n- Các hiệp sĩ phải thu gom các nguyên liệu yêu cầu\r\n- Có loại sẽ rơi ra khi tiêu diệt quái +- 5 level so với nhân vật , mỗi quái vật khác nhau sẽ rơi ra các nguyên liệu tạo Mề Đay cấp 1 khác nhau - bao gồm cả Boss , và cả quái trong phó bản\r\n- Có loại sẽ chỉ có trong chiến trường khi tiêu diệt Boss - nhà chính - quái trong map chiến trường[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14682085429119.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n• 5 nguyên liệu cấp 1 -> 1 nguyên liệu cấp 2\r\n• 5 nguyên liệu cấp 2 -> 1 nguyên liệu cấp 3\r\n- Khi có nguyên liệu cấp 3 , các hiệp sĩ có thể tiến hành chế tạo Mề Đay\r\n∇ Nâng Cấp Mề Đay\r\n- Khi chế tạo một Mề Đay , các hiệp sĩ có thể biết được số dòng ẩn có thể có\r\n- Khi +9 của Mề Đay đó , tất cả các dòng ẩn sẽ được mở hết.[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14682085423314.png[/img][/font][/size][/color][/center]\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14682084943228.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial][color=blue][i]Lưu ý\r\n- Các hiệp sĩ có thể sử dụng Mề Đay khác phái\r\n- Mề Đay khi sử dụng sẽ trang bị thứ 2 . Bấm vào ô vũ khí để có thể chuyển sang trang bị thứ 2 hoặc gặp NPC Hammer để tháo Mề Đay\r\n- Mề Đay sẽ luôn thay đổi nguyên liệu yêu cầu mỗi khi bạn chế tạo xong 1 cái\r\n- Mề Đay cũng sẽ đổi nl khi đạt các mốc nâng cấp\r\n[/i][/color][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=blue][i][img]http://forum.knightageonline.com/app/view/forum/14682085428560.png[/img][/i][/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial][color=blue][i]\r\n- Các nguyên liệu chế tạo Mề Đay có thể mua bán trên khu mua bán[/i][/color][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][b][color=red][font=verdana]Khu mua bán[/font][/color][/b][/font][/size][/color][/center]\r\n\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14682223084709.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n[b][color=red]Một số thay đổi về Mề đay[/color][/b]\r\n- Cùng với việc thay đổi dòng sát thương , các hiệp sĩ có thay đổi luôn cả % dòng sát thương trên mề đay cho thật phù hợp với mề đay . Nếu mề đay có hơn 1 dòng tăng % sát thương thì khi đổi hệ thống sẽ random 1 trong những dòng để đổi\r\n- Mề đay có thể nâng cấp đến +15\r\n- Ngoài ra mề đay còn có thể đục lỗ và khảm ngọc nguyên thủy [ chỉ khảm được ngọc này ]\r\n- Ngọc Nguyên Thủy có thể nhặt được khi các bạn đào ngọc ở các Map ngọc khảm mới\r\n\r\n[b][color=red]Chức năng Đóng/ Mở rơi nguyên liệu mề đay[/color][/b]\r\n\r\n- Chức năng hoàn toàn miễn phí\r\n- Nếu các bạn không muốn đánh quái nhặt tự động mà nhặt nguyên liệu làm full hành trang , hãy chọn đóng rơi nguyên liệu mề đay thì tất cả nguyên liệu sẽ không rơi nữa ,mà đã không rơi thì sẽ không nhặt được làm full\r\n- Nếu các bạn muốn nguyên liệu mề đay rơi lại hãy chọn Mở rơi nguyên liệu mề đay thì sẽ rơi lại bình thường khi đánh quái.\r\n- Hãy nhớ Mở rơi nguyên liệu mề đay khi Phó bản , săn Boss , hay chiến trường nhé , nếu các bạn muốn nhặt NL vàng, tím nhé .\r\n- Khi thoát game vào lại , hệ thống sẽ mặc định lại là Mở rơi nguyên liệu mề đay, nên nhớ kích hoạt lại nhé.\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red]Tác dụng đặc biệt của dòng ẩn Mề đay[/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n- [b]Khiên ma thuật[/b] : Giảm 50% st nếu quá 10% máu hiện tại\r\n\r\n- [b]Bỏng lạnh[/b] gây mất A% mp trong B giây. Tối đa số mp mất trong mỗi giây là 8%.\r\n\r\n- [b]Bỏng lửa[/b] : gây mất A% máu trong B giây. Tối đa số máu mất trong mỗi giây là 8%\r\n\r\n- [b]Giáp hắc ám[/b] : chuyển 1 phần sát thương của đối thủ thành giáp\r\n\r\n- [b]Tàng hình[/b] : tàng hình trong 1 khoảng thời gian nhất định , vẫn thi triển được skill\r\n\r\n- [b]Lú lẫn[/b] : Làm cho đối phương không thể tấn công và mất phương hướng di chuyển[/font][/size][/color]\r\n', 'chipdev', '2023-11-05 23:13:17', 0, 1, NULL, 0, 0),
	(8, 'Tác dụng của các dòng ẩn đặc biệt Mề đay', '[color=#1e5b7e][size=15][font=Arial][b]Tác dụng của các dòng ẩn đặc biệt Mề đay.[/b][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red]Tác dụng đặc biệt của dòng ẩn Mề đay[/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n- [b]Khiên ma thuật[/b] : Giảm 50% st nếu quá 10% máu hiện tại\r\n\r\n- [b]Bỏng lạnh[/b] gây mất A% mp trong B giây. Tối đa số mp mất trong mỗi giây là 8%.\r\n\r\n- [b]Bỏng lửa[/b] : gây mất A% máu trong B giây. Tối đa số máu mất trong mỗi giây là 8%\r\n\r\n- [b]Giáp hắc ám[/b] : chuyển 1 phần sát thương của đối thủ thành giáp\r\n\r\n- [b]Tàng hình[/b] : tàng hình trong 1 khoảng thời gian nhất định , vẫn thi triển được skill\r\n\r\n- [b]Lú lẫn[/b] : Làm cho đối phương không thể tấn công và mất phương hướng di chuyển[/font][/size][/color]\r\n', 'chipdev', '2023-11-05 23:13:37', 0, 1, NULL, 0, 0),
	(9, 'Hướng Dẫn - Chức Năng VÒNG XOAY MAY MẮN', '[color=#1e5b7e][size=15][font=Arial][b]Hướng Dẫn - Chức Năng VÒNG XOAY MAY MẮN[/b][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14600235348997.png[/img][/font][/size][/color][/center]\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/1460023045368.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n[color=red][b]- Luật chơi:[/b][/color]\r\n\r\n- Tại NPC Cướp Biển sẽ có Vòng quay thường và Vòng quay Vip\r\n\r\nGiá trị nhập vàng của mỗi người ở Vòng quay thường từ 10.000 - 100.000 vàng\r\n\r\nGiá trị nhập vàng của mỗi người ở Vòng quay Vip từ 1.000.000 - 50.000.000 vàng\r\n\r\nĐể tham gia Vòng quay Vip bạn phải sở hữu trên 5.000.000 vàng\r\n\r\nMỗi người chơi chỉ được phép nhập vàng 1 lần/ 1 lượt quay.\r\n\r\nVòng quay sẽ bắt đầu khi có 2 người chơi trở lên. Sau 2 phút thì sẽ có kết quả người chơi may mắn.\r\n\r\nCòn 10 giây cuối sẽ khóa không thể tham gia.\r\n\r\nNgười chiến thắng sẽ nhận hết tổng số tiền tất cả người chơi khác đặt cược sau khi đã trừ thuế.\r\n\r\nThuế sẽ là 10%.\r\n\r\nNgười có vàng trên lớn hơn 1 tỷ sẽ không thể tham gia vòng quay may mắn.\r\n\r\n[color=red][b]- Bảng thông tin:[/b][/color]\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14600230458918.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\nThời gian: 2:00 - Thời gian vòng quay còn 2 phút 00 giây nữa sẽ bắt đầu. Đây là thời gian hiện tại của vòng quay lúc bạn chọn Menu thông tin.\r\n\r\nTổng số: 10.000.000 - Đây là tổng số vàng của tất cả người chơi ngay tại lượt quay đó tính tới thời điểm đó.\r\n\r\nTỉ lệ thắng :100%\r\n\r\n- Tùy thuộc vào số vàng bạn tham gia và tổng số vàng trong lượt quay mà bạn sẽ có tỉ lệ thắng khác nhau. Tỉ lệ thắng của bạn sẽ thay đổi liên tục khi có người chơi tham gia vào.\r\n\r\nNgười vừa chiến thắng: vampirecat - người vừa chiến thắng ở lượt quay trước đó.\r\n\r\nSố vàng thắng: 98.980.000 - Số vàng nhận được khi chiến thắng.\r\n\r\nSố vàng tham gia: 5.000.000 - Số vàng tham gia vào lượt quay đó.[/font][/size][/color]\r\n', 'chipdev', '2023-11-05 23:13:58', 0, 1, NULL, 0, 0),
	(10, 'Hướng dẫn - Chức năng LÔI ĐÀI', '[color=#1e5b7e][size=15][font=Arial][b]Hướng dẫn - Chức năng LÔI ĐÀI[/b][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]https://scontent.fsgn4-1.fna.fbcdn.net/v/t1.18169-9/23795097_786349891566873_764743553125591765_n.png?stp=dst-png_p526x395&_nc_cat=101&ccb=1-7&_nc_sid=730e14&_nc_ohc=wdG8l0yQzncAX-DD8Mg&_nc_ht=scontent.fsgn4-1.fna&oh=00_AfA8AflysQ-ws0sFLRC1B9u1fMt83ZeL_H_J_JmC3gmjPg&oe=64A8B25C[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n[b]Đăng ký[/b]\r\n- Đăng ký tham gia tại Npc Miss Oda. Level từ 60 trở lên mới được tham gia lôi đài.\r\n- Thời gian chạy lôi đài sẽ là 18h30.\r\n- Phí đăng ký là 5 ngọc cho 1 lần ( 14 ngày )\r\n\r\n[b]Nội dung chi tiết[/b]\r\n- Mỗi máy chủ sẽ chia cặp dựa theo số điểm lôi đài của người chơi\r\n- Lôi đài diễn ra 10 vòng ( trận) đấu, mỗi vòng ( trận ) cách nhau 2 phút chờ\r\n- Một vòng ( trận ) đấu sẽ diễn ra trong vòng 5 phút, gồm 3 hiệp :\r\n• Thắng 1 hiệp mà hết giờ thì xem như là thắng chung cuộc\r\n• Mỗi người thắng 1 hiệp mà hết giờ thì hòa\r\n\r\n[b]Khán giả[/b]\r\n- Người chơi khác muốn vào xem hay cổ vũ các trận đấu thì đến gặp Npc Oda.\r\n\r\n[b]Cách tính điểm như sau :[/b]\r\n==> Nếu hai đối thủ bằng điểm nhau, người nào thắng thì + 30 điểm , người thua bị -30\r\n\r\n==> Người có điểm lôi đài cao hơn thắng thì điểm = 30 - ( con số chênh lệch điểm lôi đài của 2 người . MAX chênh lệch là 15 điểm )\r\n[i]ví dụ : A có 100 điểm thắng B có 70 điểm lôi đài trận đấu thì A được +15 điểm , còn B bị -15 điểm[/i]\r\n\r\n==> Người có điểm lôi đài thấp hơn thắng thì điểm = 30 + ( con số chênh lệch điểm lôi đài của 2 người )\r\n[i]ví dụ : C có 100 điểm thắng D có 150 điểm lôi đài trận đấu thì C được +45 điểm , còn D bị -45 điểm[/i]\r\n\r\n[b]Đổi danh hiệu[/b][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/15126386526418.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n+ Danh hiệu Đại hiệp sĩ, tương tứng với điểm lôi đài >= 2520. Công thức đổi VÀNG = ĐIỂM LÔI ĐÀI x5.000. Tối đa rương vàng nhận được : 10\r\n+ Danh hiệu Hiệp sĩ tương ứng với điểm lôi đài < 2520 và >= 1680. Công thức đổi VÀNG = ĐIỂM LÔI ĐÀI x4.000. Tối đa rương vàng nhận được : 5\r\n+ Danh hiệu Hiệp sĩ nhỏ tương ứng với điểm lôi đài < 1680 và >= 1260. Công thức đổi VÀNG = ĐIỂM LÔI ĐÀI x1.000 . Tối đa rương vàng nhận được : 3\r\n+ Danh hiệu Hiệp sĩ tập sự tương ứng với điểm lôi đài < 1260 và >= 840. Công thức đổi VÀNG = ĐIỂM LÔI ĐÀI x800 . Tối đa rương vàng nhận được : 2\r\n+ Danh hiệu Lính canh tương ứng với điểm lôi đài < 840 . Công thức đổi VÀNG = ĐIỂM LÔI ĐÀI x500 . Tối đa rương vàng nhận được : 1\r\n\r\n- Đây là quy định điều chỉnh thay đổi mới nhất thay cho thông báo ngày 3/8.\r\n- Khi đổi quà , Danh Hiệu sẽ được set cho nhân vật , toàn bộ điểm sẽ reset lại\r\n\r\n\r\n[b][color=red]Chia nhóm lôi đài như sau :[/color][/b]\r\n+ Nhóm 1 : từ level 60 đến 74\r\n+ Nhóm 2 : từ level 75 đến 84\r\n+ Nhóm 3 : từ level 85 đến 94\r\n+ Nhóm 4 : từ level 95 đến 104\r\n+ Nhóm 5 : từ level 105 đến 114\r\n+ Nhóm 6 : từ level 115 đến 124\r\n+ Nhóm 7 : từ level 125 trở lên\r\n[b]Vì lý do nhóm 8 quá level 135 trở đi quá ít nên sẽ gộp vào đánh cùng nhóm 7[/b]\r\n\r\n[b][color=red]Quà cho top nhóm lôi đài như sau :[/color][/b]\r\n[b]- Top 1 nhóm 1 đến nhóm 4 sẽ được phần quà sau :[/b]\r\n• Top 1 : 3 đá 3 màu , 10 lông ( ngẫu nhiên xanh - đỏ - vàng ) , 10 xương , 1 đồng Tyche, 1 đồng Horae , 1 đá Krypton cấp 1[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/15270669162523.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n• Top 2 : 5 lông ( ngẫu nhiên xanh - đỏ - vàng ) , 5 xương , 1 đồng Tyche, 1 đồng Horae\r\n• Top 3 : 3 lông ( ngẫu nhiên xanh - đỏ - vàng ) , 3 xương , 1 đồng Horae\r\n\r\n[b]- Top 1 nhóm 5 đến nhóm 7 sẽ được phần quà sau :[/b]\r\n• Top 1 : 3 đá 3 màu , 1 sách skill ( ngẫu nhiên class ), 1 đồng Tyche, 1 đồng Horae , 1 sách tri thức , 1 đá Krypton cấp 1 ,[b]thêm 5 nguyên liệu tinh tú bất kì , ngẫu nhiên 1 lửa tinh tú[/b]\r\n• Top 2 : 2 đá 3 màu , 1 đồng Tyche, 1 đồng Horae , 1 sách tri thức, [b]thêm 3 nguyên liệu tinh tú bất kì , ngẫu nhiên 1 lửa tinh tú[/b]\r\n• Top 3 : 1 đá 3 màu , 1 đồng Tyche, 1 đồng Horae , 1 sách tri thức, [b]thêm 2 nguyên liệu tinh tú bất kì , ngẫu nhiên 1 lửa tinh tú[/b]\r\n\r\n- Khi đổi quà, toàn bộ điểm sẽ reset lại\r\n\r\n[b]- Thông Báo[/b]\r\n- 10 người thuộc top danh vọng khi đấu Lôi Đài sẽ có thông báo\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]1 Số Thay Đổi về Lôi Đài [ áp dụng từ 24.1.2019][/b][/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n- Để tạo động lực cho các bạn tham gia :\r\n- Kề từ lúc các bạn tham gia lôi đài , nếu số điểm các bạn kiếm được < 1260 ( đạt mốc Hiệp sĩ tập sự ) sẽ không bị trừ điểm khi đánh thua. Từ >= 1260 trở đi vẫn tính trừ điểm bình thường . Thắng vẫn tính điểm bình thường\r\n[b]- Quà cho thi đấu lôi đài sẽ có 1 số thay đổi như sau :[/b]\r\n- Quà Top không thay đổi , tuy nhiên để lọt top các bạn phải >= [b]800[/b], nếu nhóm đó không có ai > số điểm này thì coi như là không có TOP\r\n+ Khi đạt Danh hiệu Đại hiệp sĩ, tương tứng với điểm lôi đài >= 2520. Các bạn sẽ được tặng thêm 1 Rương Thần Kỳ\r\n+ Khi đạt Danh hiệu Hiệp sĩ tương ứng với điểm lôi đài < 2520 và >= 1680. Các bạn sẽ được tặng thêm 1 Rương Ma Thuật\r\n+ Khi đạt Danh hiệu Hiệp sĩ nhỏ tương ứng với điểm lôi đài < 1680 và >= 1260. Các bạn sẽ được tặng thêm 1 Rương Huyền Thoại.\r\n\r\n- Ngoài ra , cứ 200 điểm các bạn sẽ được 1 rương vàng. Ví dụ : lovvvve đạt được 2145 điểm thì sẽ nhận được 10 rương vàng ( tối đa rương nhận được là 10)\r\n\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]1 Số Thay Đổi về Lôi Đài [ áp dụng từ 1/10/2020][/b][/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\nĐiều chỉnh lại luật lôi đài . Tính từ mùa mới\r\n- Khi các bạn tụt level như thế nào , thì hệ thống vẫn chia nhóm các bạn vào nhóm đúng với level cao nhất các bạn đạt được [áp dụng từ bây giờ 1/10/2020 thôi nhé , trước ngày đó tụt level thì không tính]\r\n\r\n- Ví dụ từ sau ngày 1/10/2020\r\nbạn level 95 dùng biến dị về level 94 thì khi đăng ký lôi đài các bạn vẫn thuộc nhóm 3 [từ level 85 đến 94] sau đó nếu lên lại level 95 thì dù có tụt vẫn là mùa sau nhóm 4[từ level 95 - 104]\r\n\r\n\r\n- Bắt đầu từ mùa mới trở đi , đăng ký lôi đài sẽ không thay đổi như thông báo ngày 3/8.\r\n- Nhưng từ mùa mới đổi vàng lôi đài sẽ điều chỉnh vàng đổi quà như sau :\r\n\r\n+ Danh hiệu Đại hiệp sĩ, tương tứng với điểm lôi đài >= 2520. Công thức đổi VÀNG = ĐIỂM LÔI ĐÀI x5.000. Tối đa rương vàng nhận được : 10\r\n+ Danh hiệu Hiệp sĩ tương ứng với điểm lôi đài < 2520 và >= 1680. Công thức đổi VÀNG = ĐIỂM LÔI ĐÀI x4.000. Tối đa rương vàng nhận được : 5\r\n+ Danh hiệu Hiệp sĩ nhỏ tương ứng với điểm lôi đài < 1680 và >= 1260. Công thức đổi VÀNG = ĐIỂM LÔI ĐÀI x1.000 . Tối đa rương vàng nhận được : 3\r\n+ Danh hiệu Hiệp sĩ tập sự tương ứng với điểm lôi đài < 1260 và >= 840. Công thức đổi VÀNG = ĐIỂM LÔI ĐÀI x800 . Tối đa rương vàng nhận được : 2\r\n+ Danh hiệu Lính canh tương ứng với điểm lôi đài < 840 . Công thức đổi VÀNG = ĐIỂM LÔI ĐÀI x500 . Tối đa rương vàng nhận được : 1[/font][/size][/color]\r\n', 'chipdev', '2023-11-05 23:14:26', 0, 1, NULL, 0, 0),
	(11, 'Hướng Dẫn - Ngọc Khảm Mới', '[color=#1e5b7e][size=15][font=Arial][b]Hướng Dẫn - Ngọc Khảm Mới[/b][/font][/size][/color]\r\n[color=#000000][size=15][font=Arial]- Tại NPC Lisa sẽ có các vé để vào khu vực đào ngọc , mỗi khu vực mỏ khác nhau sẽ có những ngọc khác nhau. Level 30 mới được vào khu mỏ. Bấm sử dụng vé để đến khu mỏ[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/15057310688853.png[/img]\r\n[img]http://my.teamobi.com/app/view/forum/15057310682814.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]- Mỗi lần vào mỏ là sẽ tốn 1 vé, nếu các bạn muốn ra khỏi khu mỏ có thể gặp NPC Anwen[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/15057310686361.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n- Mỗi loại ngọc sẽ chỉ có thể khảm vào 1 số trang bị nhất định\r\n• Ngọc Hỗn Nguyên và Ngọc Khải Hoàn chỉ có thể khảm vào vũ khí[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/15058822428067.jpg[/img]\r\n[img]http://my.teamobi.com/app/view/forum/15058823025418.jpg[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n• Ngọc Lục Bảo và Ngọc Phong Ma chỉ có thể khảm vào trang phục : quần, áo , nón , giày , găng tay[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/15058822427433.jpg[/img]\r\n[img]http://my.teamobi.com/app/view/forum/15058822429793.jpg[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n• Ngọc Sinh Mệnh và Ngọc Tâm Linh chỉ có thể khảm vào trang sức: nhẫn , dây chuyền[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/1505882302956.jpg[/img]\r\n[img]http://my.teamobi.com/app/view/forum/15058823026650.jpg[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n[b]Lưu ý :[/b]\r\n- Để khảm được ngọc thì trang bị phải có lỗ , để tạo lỗ thì các bạn có thể mua Đục Huyền bí để đục lỗ.\r\n- Mỗi lần khảm chỉ được khảm 1 viên/ 1 lần, khảm không thành công sẽ bị mất ngọc.\r\n- Ngọc cấp 1 và ngọc cấp 2 , cấp 3 có thể mua bán và giao dịch trên khu mua bán.\r\n- Quái trong khu mỏ thì đánh 10 hit sẽ chết , không có HP\r\n- Ngọc đào sẽ là ngọc cấp 1 , các bạn có thể ép lên cấp cao hơn và max là ngọc cấp 5\r\n- Ngọc cấp càng cao thì càng giá trị . Tuy nhiên tùy ngọc mà các bạn khảm số lượng cho hợp lý nhé\r\n- Để tháo ngọc khảm các bạn vào NPC Oda, lưu ý cần phải sử dụng vật phẩm đó mới có thể tháo ngọc\r\n\r\nví dụ\r\nngọc cấp 1 hồi máu 1% , thì cấp 5 hồi máu 10%\r\nngọc cấp 1 25 hit đánh mới có xuất hiện tác dụng thì ngọc cấp 5 là 5 hit sẽ xuất hiện tác dụng\r\n\r\n[b][color=red]Một số thay đổi về Ngọc Khảm mới[/color][/b]\r\n- Tinh luyện ngọc khảm mới , chọn loại ngọc muốn tinh luyện trong hành trang, nhấn sử dụng, phí mỗi viên từ cấp 1 tới cấp 5 là : 1tr- 2tr-3tr-4tr-5tr vàng\r\n- Chỉ những ngọc nào có bất lợi mới có thể tinh luyện như ngọc lục bảo , ngọc sinh mệnh , ngọc hỗn nguyên , ngọc khải hoàn\r\n- Để tháo ngọc khảm món khác class , các bạn có thể dùng nút KHÁC để tháo.[/font][/size][/color]\r\n\r\n[color=#000000][size=15][font=Arial][b][color=red]ngọc hỗn nguyên cấp 1 : [/color][/b]Khảm vô vũ khí, khi đánh trúng 25 hit lên [người khác, boss] sẽ được x2 sát thương, giảm 50% Hp, tồn tại trong 3 giây\r\n====> hi sinh 50% máu của mình để x2 dame lên chứ không phải giãm 50% hp của đối thủ. Trong vòng 3s đó tất cả hit của bạn đánh ra đều x2 nhưng trừ 1 lần 50% cho 3 giây huy hoàng đó.\r\nCách tinh hit của ngọc này cũng đơn giản . Ví dụ : các bạn khảm 3 viên lần lượt là :\r\n1 viên cấp 1 là 25 hit\r\n1 viên cấp 3 là 15 hit\r\n1 viên cấp 4 là 10 hit\r\n-->theo công thức trung bình cộng thì tổng số hit cuối cùng bằng (25+15+10) / 3 = 16 hit\r\n\r\n[b][color=red]- ngọc khải hoàn cấp 1 :[/color][/b] Khảm vô vũ khí. Khi bị đánh trúng 25 hit sẽ kháng tất cả các loại hiệu ứng lên nhân vật, bị giảm tỷ lệ né tránh, chí mạng, phảm đam, xuyên giáp đi 20%, tồn tại trong 3 giây . Lưu ý : đối thủ ở đây tính hết quái , boss , người chơi , cướp máy , lính canh .....\r\n====> hiệu ứng ở đây tức là : trói chân , choáng , đóng băng , ru ngủ , bỏng lạnh , lú lẫn , bỏng lửa , vết thương sâu ...... [b]CẢ BOSS lẫn đối thủ ĐỀU KHÁNG[/b]\r\n\r\n[b][color=red]- ngọc phong ma cấp 1 :[/color][/b]Khi hp < 20% sẽ có khả năng xảy ra sau mỗi lần tấn công, hồi 1% hp sau mỗi nhát đánh, tồn tại trong 3 giây, tỉ lệ 0.5%\r\n====>Tức là khi máu của bạn chỉ còn 20% so với thanh máu thì ngọc này sẽ phát huy tác dụng , bơm 1% trong mỗi lần đánh. Khảm nhiều thì điều kiện <20% sẽ tăng lên và tỉ lệ hồi 1% cũng cao lên .\r\nLượng máu yêu cầu để có thể xảy ra là trung bình cộng\r\nlượng máu được cộng : trung bình cộng\r\nTỷ lệ xảy ra : Cộng dồn\r\n\r\n[b][color=red]- ngọc lục bảo cấp 1 :[/color][/b]Chuyển 10% sát thương của đối thủ thành máu cho mình , không hồi hp trong thời gian này. Tồn lại trong 3 giây , tỉ lệ xuất hiện %\r\n====> Nếu bạn khảm nhiều hơn thì tỉ lệ chuyển hóa vẫn là 10% , chỉ tăng tỉ lệ % xuất hiện.Ví dụ như trong vòng 3 giây hiệu ứng đối thủ đánh bạn được 2 skill thì bạn sẽ được hưởng 10% skill 1 + 10% skill 2 . Lưu ý : đối thủ ở đây tính hết quái , boss , người chơi , cướp máy , lính canh .....\r\n- đồi cát : khải hoàn , sinh mệnh\r\n- hang động : tâm linh , phong ma\r\n- thảo nguyên : hỗn nguyên , lục bảo\r\n- đồi cỏ : khải hoàn , lục bảo [/font][/size][/color]\r\n', 'chipdev', '2023-11-05 23:15:08', 0, 1, NULL, 0, 0),
	(12, 'Hướng dẫn - Chức năng THÚ CƯỠI', '[color=#1e5b7e][size=15][font=Arial][b]Hướng dẫn - Chức năng THÚ CƯỠI[/b][/font][/size][/color]\r\n[color=#000000][size=15][font=Arial][b]Thú cưỡi[/b]\r\n\r\n- Đây là chức năng dành cho Bang Hội\r\n- Để có Thú cưỡi Sói Xám , Thủ Lĩnh có thể mua tại shop Bang Hội cho các thành viên trong bang đều có thể xài được[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14779057631493.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n- Sau khi mua , thú cưỡi sẽ nằm ngay trong Kho Bang , các thành viên chỉ cần lại NPC Zoro để sử dụng Sói Xám[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://forum.knightageonline.com/app/view/forum/14779057631336.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n- Khi cưỡi Sói Xám mà bị giết hay thoát game vào lại vẫn cưỡi Sói Xám . Khi tháo là mất chứ không nằm trong hành trang cá nhân .\r\n- Nếu các hiệp sĩ không muốn cưỡi có thể tháo Thú cưỡi Sói Xám tại NPC Hammer hoặc Alisama , và nếu muốn sử dụng thì cứ vào Kho Bang\r\n- Các hiệp sĩ rời bang thì mất thú cưỡi Sói Xám\r\n- Bang hội đã có thêm thú cưỡi mới khác cho các thủ lĩnh chọn lựa cho bang của mình[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/16386090557591.png[/img][/font][/size][/color][/center]\r\n', 'chipdev', '2023-11-05 23:15:25', 0, 1, NULL, 0, 0),
	(13, 'Hướng Dẫn - Chức năng BANG HỘI', '[color=#1e5b7e][size=15][font=Arial][b]Hướng Dẫn - Chức năng BANG HỘI[/b][/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]Cánh Thời Trang BANG HỘI[/b][/color][/font][/size][/color][/center]\r\n\r\n\r\n[center][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n- Để có thể mua cánh thời trang các bạn cần đủ tiền trong quỹ bang và vé mua cánh thời trang bang\r\n- Vé mua cánh thời trang bang hội có thể kiếm trong chiếm mỏ , khi các bạn đánh sập mỏ thì sẽ có khả năng nhặt được vật phẩm này\r\n- Vé có thể mua bán nên các bạn có thể chuyển cho thủ lĩnh\r\n\r\n[b]Lưu ý: Tất cả cánh thời trang có dòng không tăng exp chỉ tính khi đánh quái , mở quà có exp . Không áp dụng cho thu hoạch mỏ , đánh cướp[/b]\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]Boss Bang Hội[/b][/color][/font][/size][/color][/center]\r\n\r\n[center][color=#000000][size=15][font=Arial][img]http://my.teamobi.com/app/view/forum/16430766984715.png[/img][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n- Bang level từ 40 ở lên được mua Bùa gọi boss.\r\n- Chỉ Thủ Lĩnh mới được gọi boss lên đánh\r\n- Boss bang chỉ đánh người của bang đó và chỉ người bang đó mới đánh được Boss\r\n- 1 khu chỉ có 1 bang được gọi boss\r\n- Khi còn boss bang thì không gọi tiếp được.\r\n- Sau khi giết boss bang thì bang được gọi tiếp sau 6 tiếng. Boss Bang sống 6 tiếng nếu không ai giết sẽ tự chết\r\n- Quà của Boss Bang :\r\nLông xanh\r\nLông đỏ\r\nLông vàng\r\nCỏ 4 lá\r\nĐá 3 màu\r\nTrang bị cam\r\nĐùi gà\r\nĐồng bạc Tyche\r\nĐá hỏa tinh\r\nKim loại vũ trụ\r\nThỏi titan\r\nHồi sinh tại chỗ\r\nĐá may mắn\r\nVé x2 đi buôn\r\nMây\r\nThánh giá\r\nNgẫu nhiên 1 item vàng/tím KHÓA\r\nLửa tinh tú\r\nPhù về làng\r\n[/font][/size][/color]\r\n[center][color=#000000][size=15][font=Arial][color=red][b]1 Số Thay Đổi về boss bang [ áp dụng từ 27/5/2022[/b][/color][/font][/size][/color][/center]\r\n[color=#000000][size=15][font=Arial]\r\n\r\n- Sau khi giết boss bang thì bang được gọi tiếp sau 3 tiếng. Boss Bang sống 3 tiếng nếu không ai giết sẽ tự chết\r\n- Tăng số lượng nl tinh tú trong quà boss bang , tăng tỉ lệ ra đồ xịn boss bang[/font][/size][/color]\r\n', 'chipdev', '2023-11-05 23:16:03', 0, 1, NULL, 0, 0),
	(15, 'Danh sách SCAM LỪA ĐẢO nên kiểm tra trước khi giao dịch', '\n[color=#212529][size=20][font=system-ui, -apple-system, "Segoe UI", Roboto, "Helvetica Neue", "Noto Sans", "Liberation Sans", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji"][i][color=#e60000]Mọi giao dịch lừa đảo đều bị nghiêm cấp tại Server Hiệp Sĩ Gold, những người chơi cung cấp thông tin SCAMMER( NGƯỜI LỪA ĐẢO ) đều sẽ nhận được code từ chúng mình. Cảm ơn mọi người đã xem và cùng chúng mình tạo môi trường chơi game lành mạnh nhé[/color][/i][/font][/size][/color]\n\n[color=#212529][size=15][font=system-ui, -apple-system, "Segoe UI", Roboto, "Helvetica Neue", "Noto Sans", "Liberation Sans", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji"][b][color=#6b24b2]THÔNG BÁO: HIỆN TẠI Ở MỖI BOX ZALO ĐỀU SẼ CÓ GIAO DỊCH VIÊN (KEY BẠC), CÁC BẠN NÊN GIAO DỊCH TRUNG GIAN QUA CÁC GDV NÀY ĐỂ TRÁNH LỪA ĐẢO NHÉ[/color][/b][/font][/size][/color]\n[b][color=#212529][size=15][font=system-ui, -apple-system, "Segoe UI", Roboto, "Helvetica Neue", "Noto Sans", "Liberation Sans", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji"]DƯỚI ĐÂY LÀ DANH SÁCH LỪA ĐẢO, GẶP LÀ BLOCK KHÔNG NÓI NHIỀU[/font][/size][/color][/b]\n[b]Ai Lừa đảo bên mình sẽ list lại cho anh em đề phòng tránh nhé[/b]\n\n[b][color=#6b24b2][size=15][font=system-ui, -apple-system, "Segoe UI", Roboto, "Helvetica Neue", "Noto Sans", "Liberation Sans", Arial, sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji"]THÔNG BÁO: HIỆN TẠI Ở MỖI BOX ZALO ĐỀU SẼ CÓ GIAO DỊCH VIÊN (KEY BẠC), CÁC BẠN NÊN GIAO DỊCH TRUNG GIAN QUA CÁC GDV NÀY ĐỂ TRÁNH LỪA ĐẢO NHÉ[/font][/size][/color] [/b]', 'chipdev', '2023-11-05 23:30:32', 0, 1, NULL, 0, 0);
